import React, { Component } from 'react';


class Uploaded extends Component {

  render() {
    const {project} = this.props;
    console.log('project', project)
    const related = project.relatedFile;
    const link = project.url;
    
      return (
        <div className="section">
        { project && related.map(related => {
          return(
            <li key={project.id}><a href={link} alt='relatedFile'>{related}</a></li> 
          )

        })}
        
      </div>
      


        // <div className="project-list section">
        //     <a href={project.url} alt='relatedFile' >{project.relatedFile}</a>
        // </div>
      )
      
}
};


export default Uploaded;
